import classname from 'classnames/bind';
import styles from './CartEndorserComponent.module.scss';

const cx = classname.bind(styles);

function CartEndorserComponent() {
    return (
        <div className={cx('cart')}>
            <img
                src="https://media.istockphoto.com/id/1126791007/vi/vec-to/bi%E1%BB%83u-t%C6%B0%E1%BB%A3ng-avatar-ngh%E1%BB%87-s%C4%A9-logo-ngh%E1%BB%81-nghi%E1%BB%87p-nh%C3%A2n-v%E1%BA%ADt-nam-m%E1%BB%99t-ng%C6%B0%E1%BB%9Di-%C4%91%C3%A0n-%C3%B4ng-trong-trang-ph%E1%BB%A5c.jpg?s=612x612&w=is&k=20&c=ntXyo_mtPWAnAnH3OZ5ba6E0KqAkUQ9VklHyY8qJWxk="
                alt=""
            />

            <div className={cx('info')}>
                <h5>John Fang </h5>
                <span>wordfaang.com</span>
                <p>
                    Suspendisse ultrices at diam lectus nullam. Nisl, sagittis viverra enim erat tortor ultricies massa
                    turpis. Arcu pulvinar aenean nam laoreet nulla.
                </p>
            </div>
        </div>
    );
}

export default CartEndorserComponent;
